Installation

Unzip the package into a temporary folder. Depending on the version of Cinema, copy the CONTENTS OF the appropriate folder (8.5, 9.5, 9.6, 10) into the /Plugins folder of your Cinema4D copy. (If you still use v9.0, use the 8.5 folder)
In Cinema4D, under Plugins menu, an item named NextLimit will appear, with four plug-ins inside:

-[NL] RealFlow mesh loader
-[NL] RealWave surface loader
-[NL] SD Import
-[NL] SD Export



